openapi: 3.0.3
info:
  title: Uber Eats 3
  version: 1.0.0
servers:
  - url: https://www.ubereats.com
tags:
  - name: allStoresV1
  - name: getFeedByIdV1
  - name: getFeedV1
  - name: getMenuItemV1
  - name: getSearchFeedV1
  - name: getSearchHomeV2
  - name: getStoreV1
  - name: getUserV1
  - name: udiMetaV1
  - name: "{id}"
paths:
  /_p/api/{id}:
    post:
      tags:
        - "{id}"
      summary: POST /_p/api/{id}
      operationId: post__p_api_id
      parameters:
        - name: id
          in: path
          required: true
          schema:
            type: string
          example: setRobotEventsV1
      requestBody:
        required: true
        content:
          application/json:
            schema:
              $ref: "#/components/schemas/{id}PostRequest"
            examples:
              fromHar:
                value:
                  action: rendered
                  payload:
                    shouldIndex: false
                    shouldIndexOverride: true
                    appVariant: eats
                    overrideAvoided: false
                    isBot: false
                    page: unknown
      responses:
        "200":
          description: Success
  /_p/api/getUserV1:
    post:
      tags:
        - getUserV1
      summary: POST /_p/api/getUserV1
      operationId: post__p_api_getUserV1
      requestBody:
        required: true
        content:
          application/json:
            schema:
              $ref: "#/components/schemas/GetUserV1PostRequest"
            examples:
              fromHar:
                value:
                  shouldGetSubsMetadata: true
      responses:
        "200":
          description: Success
  /_p/api/getSearchHomeV2:
    post:
      tags:
        - getSearchHomeV2
      summary: POST /_p/api/getSearchHomeV2
      operationId: post__p_api_getSearchHomeV2
      requestBody:
        required: true
        content:
          application/json:
            schema:
              $ref: "#/components/schemas/GetSearchHomeV2PostRequest"
            examples:
              fromHar:
                value:
                  dropPastOrders: true
      responses:
        "200":
          description: Success
  /_p/api/getFeedByIdV1:
    post:
      tags:
        - getFeedByIdV1
      summary: POST /_p/api/getFeedByIdV1
      operationId: post__p_api_getFeedByIdV1
      requestBody:
        required: true
        content:
          application/json:
            schema:
              $ref: "#/components/schemas/GetFeedByIdV1PostRequest"
            examples:
              fromHar:
                value:
                  feedID: convenience_feed
                  deliveryLocation:
                    - type: USER
                    - type: GEOIP
                  feedmakerCtx: ""
      responses:
        "200":
          description: Success
  /_p/api/allStoresV1:
    post:
      tags:
        - allStoresV1
      summary: POST /_p/api/allStoresV1
      operationId: post__p_api_allStoresV1
      requestBody:
        required: true
        content:
          application/json:
            schema:
              $ref: "#/components/schemas/AllStoresV1PostRequest"
            examples:
              fromHar:
                value:
                  date: ""
                  startTime: 0
                  endTime: 0
                  sortAndFilters:
                    - uuid: f744706c-2b1b-4db2-b40a-13d43cb338da
                      options:
                        - uuid: 13ce1932-1878-4e2e-80d0-5760c095c641
                  surfaceName: HOME
                  cacheKey: ""
                  verticalType: ""
      responses:
        "200":
          description: Success
  /_p/api/getFeedV1:
    post:
      tags:
        - getFeedV1
      summary: POST /_p/api/getFeedV1
      operationId: post__p_api_getFeedV1
      requestBody:
        required: true
        content:
          application/json:
            schema:
              $ref: "#/components/schemas/GetFeedV1PostRequest"
            examples:
              fromHar:
                value:
                  cacheKey: /DELIVERY///0/0//JTVCJTVE/undefined//////HOME/SHOP///////
                  feedSessionCount:
                    announcementCount: 0
                    announcementLabel: ""
                  userQuery: ""
                  date: ""
                  startTime: 0
                  endTime: 0
                  carouselId: ""
                  sortAndFilters: []
                  billboardUuid: ""
                  feedProvider: ""
                  promotionUuid: ""
                  targetingStoreTag: ""
                  venueUUID: ""
                  selectedSectionUUID: ""
                  favorites: ""
                  vertical: ""
                  searchSource: ""
                  searchType: ""
                  keyName: ""
                  serializedRequestContext: ""
                  verticalType: SHOP
                  isUserInitiatedRefresh: false
      responses:
        "200":
          description: Success
  /_p/api/getSearchFeedV1:
    post:
      tags:
        - getSearchFeedV1
      summary: POST /_p/api/getSearchFeedV1
      operationId: post__p_api_getSearchFeedV1
      requestBody:
        required: true
        content:
          application/json:
            schema:
              $ref: "#/components/schemas/GetSearchFeedV1PostRequest"
            examples:
              fromHar:
                value:
                  userQuery: Halal
                  date: ""
                  startTime: 0
                  endTime: 0
                  sortAndFilters: []
                  vertical: ""
                  searchSource: HOME_FEED_FILTER
                  displayType: SEARCH_RESULTS
                  searchType: ""
                  keyName: ""
                  cacheKey: ""
                  recaptchaToken: ""
      responses:
        "200":
          description: Success
  /_p/api/getStoreV1:
    post:
      tags:
        - getStoreV1
      summary: POST /_p/api/getStoreV1
      operationId: post__p_api_getStoreV1
      requestBody:
        required: true
        content:
          application/json:
            schema:
              $ref: "#/components/schemas/GetStoreV1PostRequest"
            examples:
              fromHar:
                value:
                  storeUuid: d937e7af-e1c9-554f-9426-2a5ef722b565
                  diningMode: DELIVERY
                  time:
                    asap: true
                  cbType: EATER_ENDORSED
      responses:
        "200":
          description: Success
  /_p/api/getMenuItemV1:
    post:
      tags:
        - getMenuItemV1
      summary: POST /_p/api/getMenuItemV1
      operationId: post__p_api_getMenuItemV1
      requestBody:
        required: true
        content:
          application/json:
            schema:
              $ref: "#/components/schemas/GetMenuItemV1PostRequest"
            examples:
              fromHar:
                value:
                  itemRequestType: ITEM
                  storeUuid: d937e7af-e1c9-554f-9426-2a5ef722b565
                  sectionUuid: 0617e935-621e-4dce-9e9a-ac217f5c0142
                  subsectionUuid: 0379a62a-1156-4ddb-a09a-7e1dc45d5dfb
                  menuItemUuid: 5ac93198-0a16-436f-9e8c-d080de743be7
                  cbType: EATER_ENDORSED
                  includeCheaperAlternatives: false
                  contextReferences:
                    - type: GROUP_ITEMS
                      payload:
                        type: groupItemsContextReferencePayload
                        groupItemsContextReferencePayload: {}
                      pageContext: STORE
      responses:
        "200":
          description: Success
  /_p/api/udiMetaV1:
    post:
      tags:
        - udiMetaV1
      summary: POST /_p/api/udiMetaV1
      operationId: post__p_api_udiMetaV1
      requestBody:
        required: true
        content:
          application/json:
            schema:
              $ref: "#/components/schemas/UdiMetaV1PostRequest"
            examples:
              fromHar:
                value:
                  meta: 
      responses:
        "200":
          description: Success
components:
  schemas:
    "{id}PostRequest":
      type: object
      properties:
        action:
          type: string
        payload:
          type: object
          properties:
            shouldIndex:
              type: boolean
            shouldIndexOverride:
              type: boolean
            appVariant:
              type: string
            overrideAvoided:
              type: boolean
            isBot:
              type: boolean
            page:
              type: string
          required:
            - shouldIndex
            - shouldIndexOverride
            - appVariant
            - overrideAvoided
            - isBot
            - page
      required:
        - action
        - payload
    GetUserV1PostRequest:
      type: object
      properties:
        shouldGetSubsMetadata:
          type: boolean
      required:
        - shouldGetSubsMetadata
    GetSearchHomeV2PostRequest:
      type: object
      properties:
        dropPastOrders:
          type: boolean
      required:
        - dropPastOrders
    GetFeedByIdV1PostRequest:
      type: object
      properties:
        feedID:
          type: string
        deliveryLocation:
          type: array
          items:
            type: object
            properties:
              type:
                type: string
            required:
              - type
        feedmakerCtx:
          type: string
      required:
        - feedID
        - deliveryLocation
        - feedmakerCtx
    AllStoresV1PostRequest:
      type: object
      properties:
        date:
          type: string
        startTime:
          type: integer
        endTime:
          type: integer
        sortAndFilters:
          type: array
          items:
            type: object
            properties:
              uuid:
                type: string
              options:
                type: array
                items:
                  type: object
                  properties:
                    uuid:
                      type: string
                  required:
                    - uuid
            required:
              - uuid
              - options
        surfaceName:
          type: string
        cacheKey:
          type: string
        verticalType:
          type: string
      required:
        - date
        - startTime
        - endTime
        - sortAndFilters
        - surfaceName
        - cacheKey
        - verticalType
    GetFeedV1PostRequest:
      type: object
      properties:
        cacheKey:
          type: string
        feedSessionCount:
          type: object
          properties:
            announcementCount:
              type: integer
            announcementLabel:
              type: string
          required:
            - announcementCount
            - announcementLabel
        userQuery:
          type: string
        date:
          type: string
        startTime:
          type: integer
        endTime:
          type: integer
        carouselId:
          type: string
        sortAndFilters:
          type: array
          items:
            type: string
        billboardUuid:
          type: string
        feedProvider:
          type: string
        promotionUuid:
          type: string
        targetingStoreTag:
          type: string
        venueUUID:
          type: string
        selectedSectionUUID:
          type: string
        favorites:
          type: string
        vertical:
          type: string
        searchSource:
          type: string
        searchType:
          type: string
        keyName:
          type: string
        serializedRequestContext:
          type: string
        verticalType:
          type: string
        isUserInitiatedRefresh:
          type: boolean
      required:
        - cacheKey
        - feedSessionCount
        - userQuery
        - date
        - startTime
        - endTime
        - carouselId
        - sortAndFilters
        - billboardUuid
        - feedProvider
        - promotionUuid
        - targetingStoreTag
        - venueUUID
        - selectedSectionUUID
        - favorites
        - vertical
        - searchSource
        - searchType
        - keyName
        - serializedRequestContext
        - verticalType
        - isUserInitiatedRefresh
    GetSearchFeedV1PostRequest:
      type: object
      properties:
        userQuery:
          type: string
        date:
          type: string
        startTime:
          type: integer
        endTime:
          type: integer
        sortAndFilters:
          type: array
          items:
            type: string
        vertical:
          type: string
        searchSource:
          type: string
        displayType:
          type: string
        searchType:
          type: string
        keyName:
          type: string
        cacheKey:
          type: string
        recaptchaToken:
          type: string
      required:
        - userQuery
        - date
        - startTime
        - endTime
        - sortAndFilters
        - vertical
        - searchSource
        - displayType
        - searchType
        - keyName
        - cacheKey
        - recaptchaToken
    GetStoreV1PostRequest:
      type: object
      properties:
        storeUuid:
          type: string
        diningMode:
          type: string
        time:
          type: object
          properties:
            asap:
              type: boolean
          required:
            - asap
        cbType:
          type: string
      required:
        - storeUuid
        - diningMode
        - time
        - cbType
    GetMenuItemV1PostRequest:
      type: object
      properties:
        itemRequestType:
          type: string
        storeUuid:
          type: string
        sectionUuid:
          type: string
        subsectionUuid:
          type: string
        menuItemUuid:
          type: string
        cbType:
          type: string
        includeCheaperAlternatives:
          type: boolean
        contextReferences:
          type: array
          items:
            type: object
            properties:
              type:
                type: string
              payload:
                type: object
                properties:
                  type:
                    type: string
                  groupItemsContextReferencePayload:
                    type: object
                    properties: {}
                    required: []
                required:
                  - type
                  - groupItemsContextReferencePayload
              pageContext:
                type: string
            required:
              - type
              - payload
              - pageContext
      required:
        - itemRequestType
        - storeUuid
        - sectionUuid
        - subsectionUuid
        - menuItemUuid
        - cbType
        - includeCheaperAlternatives
        - contextReferences
    UdiMetaV1PostRequest:
      type: object
      properties:
        meta:
          type: string
      required:
        - meta
